import axios from "axios";
import { BASE_URL } from "./constants/Constants";

const instance = axios.create({
    baseURL: BASE_URL,
    headers: {
      "Access-Control-Allow-Origin": "*",
      "Content-Type": "text/plain",
    },
  });

  export default instance
